console.info("FPATH");

const chars = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ1234567890!@#$%^&*()+?~";

const getRandom = (thing) => {
  return thing[Math.floor(Math.random() * thing.length)];
}

const generateSprites = (count, x=1) => {
  const sprites = document.getElementsByClassName("fpath-sprite");
  if (sprites.length >= count) return sprites;
  count = count - sprites.length;
  console.log("MAKING SPRITES", count);
  for(let i =0; i < (count*x); i++){
    let sprite = document.createElement("span") 
    sprite.appendChild(document.createTextNode(getRandom(chars)));
    sprite.setAttribute("class", "fpath-sprite");
    sprite.setAttribute("style", `position:absolute;left:-20px;top:-20px;`) 
    document.body.appendChild(sprite)
  }
  return document.getElementsByClassName("fpath-sprite");
}

const moveSprite = (sprite,x,y,coords) => {
  sprite.setAttribute("style", `position:absolute;left:${parseInt(sprite.style.left)+x}px;top:${parseInt(sprite.style.top)+y}px;`) 
  moveSpriteTo(sprite,coords);
}
const moveSpriteTo = (sprite, coords) => {
  let step = Math.floor(Math.random() * 20);
  let coordsx = Math.floor(coords.x);
  let coordsy = Math.floor(coords.y);
  let x = (parseInt(sprite.style.left) > coordsx ) ? -step : (parseInt(sprite.style.left)=== coordsx)? 0 : step;
  let y = (parseInt(sprite.style.top) > coordsy ) ? -step : (parseInt(sprite.style.top)=== coordsy)? 0 : step;
  if(parseInt(sprite.style.left) === coordsx && parseInt(sprite.style.top) === coordsy) return;
  setTimeout(() => moveSprite(sprite,x,y,coords), step)
}

const translatePathToDom = (path, x=4) => {
  const svg = document.getElementById("svgCanvas")
  const pathNode = svg.querySelector('path');
  pathNode.setAttribute('d', path);
  const length = pathNode.getTotalLength();
  const sprites = generateSprites(length)

  for(let i = 0;i < (sprites.length);i++){
    let p = pathNode.getPointAtLength(i > length ? i - length : i);
    let pos = p.matrixTransform( svg.getScreenCTM() );
    moveSpriteTo(sprites[i], pos); 
  }
}

